icons.js\";}s:16:\"material-twotone\";a:4:{s:4:\"name\";s:17:\"Material Two Tone\";s:4:\"icon\";s:14:\"material-icons\";s:6:\"handle\";s:22:\"material-twotone-4.0.0\";s:4:\"file\";s:8:\"icons.js\";}}s:11:\"release-log\";s:24363:\"<!-- FEED-ENTRY -->\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.11.1\n			<ls-small>May 22, 2024</ls-small>\n		</ls-h5>\n		<ls-p>This release contains important security fixes. Updating is strongly recommended to everyone.</ls-p><ls-ul><ls-li>Updated French localization. [Thanks to <a href=\"https://instinct-photo.fr/contact/\" target=\"_blank\">Patrick Perrono</a>]</ls-li><ls-li>Hover Transition\'s default easing has been changed from easeInOutQuint to easeOutQuart. Existing projects remain unaffected.</ls-li><ls-li>Fixed various layout and behavior issues that affected popups.</ls-li><ls-li>Fixed layer positioning issues with certain percentage values.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n<!-- FEED-ENTRY -->\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.11.0\n			<ls-small>Apr 22, 2024</ls-small>\n		</ls-h5>\n		<ls-p>This version of LayerSlider showcases an <strong>all-new add-on manager</strong>, unveiling the arrival of its latest addition: the <strong>404 add-on</strong>. Don’t let those dull 404 “Not Found” error messages be a dead-end for your visitors. LayerSlider’s 404 add-on empowers you to transform those boring and frustrating error pages into captivating experiences.</ls-p><ls-p>Other changes:</ls-p><ls-ul><ls-li>Revisions can now be disabled, and it also offers the option to delete saved snapshots.</ls-li><ls-li>Fixed a rare font-weight problem affecting Google Fonts.</ls-li><ls-li>Fixed Smart Operations where property values were zero.</ls-li><ls-li>UI and under-the-hood fixes and improvements.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n<!-- FEED-ENTRY -->\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.10.1\n			<ls-small>Mar 27, 2024</ls-small>\n		</ls-h5>\n		<ls-p>This update includes important security fixes.</ls-p>\n	</ls-box>\n</ls-li>\n<!-- FEED-ENTRY -->\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.10.0\n			<ls-small>Mar 20, 2024</ls-small>\n		</ls-h5>\n		<ls-p><strong>IMPORTANT</strong>: This release changes the default text selection behavior for new projects. <a href=\"https://layerslider.com/blog/new-text-selection-behavior-in-layerslider-7-10/\" target=\"_blank\">Learn More</a></ls-p><ls-ul><ls-li>Added Project Settings → Miscellaneous → Prevent Selection option to restrict the selection of text and other interface elements within your projects.</ls-li><ls-li>Added Layer Styles → Advanced Settings → Selection option to control selection behavior on individual layers as necessary.</ls-li><ls-li>Added indicators to several UI elements, showing the number of layer actions, attributes, links, etc., at a glance.</ls-li><ls-li>Added undo/redo and multiple layer selection support for layer actions.</ls-li><ls-li>Overflow now offers the value “Auto”, which can make layers’ content scrollable.</ls-li><ls-li>The default mouse cursor setting has been changed to “Layer-specific”, which should better follow the designer’s intent out of the box.</ls-li><ls-li>Fixed issues with pasting layer style and transition properties.</ls-li><ls-li>Fixed several issues animating the width and height transition properties of Opening and Ending Transitions.</ls-li><ls-li>User interface revamps, performance improvements, and several changes under the hood.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n<!-- FEED-ENTRY -->\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.9.11\n			<ls-small>Feb 28, 2024</ls-small>\n		</ls-h5>\n		<ls-ul><ls-li>The Project Settings → Layout → Max-width option now supports the vw (percentage of viewport width) unit.</ls-li><ls-li>Project Settings → Appearance now has a new Apply Background To option.</ls-li><ls-li>The \"Open Popup\" layer action now uses project slugs (if any) to work when projects are moved across sites.</ls-li><ls-li>Fixed a rare rendering issue when opening popups.</ls-li><ls-li>Fixed animating Hover Transition’s offset transformations.</ls-li><ls-li>Under-the-hood improvements and bug fixes.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.9.10\n			<ls-small>Feb 15, 2024</ls-small>\n		</ls-h5>\n		<ls-ul><ls-li>Added a new option to close popups when pressing the Escape key on the keyboard.</ls-li><ls-li>Added a new advanced option to make popups scrollable instead of staying fixed on the screen.</ls-li><ls-li>Added a new Scroll Position option to relevant layer actions to offer precise control over vertical placement.</ls-li><ls-li>Under-the-hood improvements and bug fixes.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.9.9\n			<ls-small>Jan 30, 2024</ls-small>\n		</ls-h5>\n		<ls-ul><ls-li>Added Mask option to the STYLE menu of layers.</ls-li><ls-li>Added more cutout examples for the Mask options.</ls-li><ls-li>Increased compatibility with 3rd party plugins.</ls-li><ls-li>Fixed modifying Wave shapes.</ls-li><ls-li>Fixed a rare layout issue when reopening the same popup multiple times with different starting slides.</ls-li><ls-li>Other improvements and bug fixes under the hood.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.9.8\n			<ls-small>Jan 22, 2024</ls-small>\n		</ls-h5>\n		<ls-ul><ls-li>Added Project Settings → Miscellaneous → Disable Context Menu option to prevent right-clicking on the slider and its elements like images.</ls-li><ls-li>The WPML integration now registers strings in the selected language that you can change from the top menu bar before entering the project editor. This change is especially useful when English is not the source/default language.</ls-li><ls-li>Fixed Safari rendering issues affecting the Origami slide transitions.</ls-li><ls-li>Other fixes under the hood.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.9.7\n			<ls-small>Jan 16, 2024</ls-small>\n		</ls-h5>\n		<ls-p>This release contains important security fixes, and updating is strongly recommended to everyone.</ls-p>\n		<ls-ul>\n			<ls-li>Scroll Transition can now be used in Popups.</ls-li>\n			<ls-li>Improvements in copying and pasting layer settings.</ls-li>\n			<ls-li>Third parties can no longer override the appearance of layers with text transitions.</ls-li>\n			<ls-li>Fixed handling unlisted Vimeo videos.</ls-li>\n			<ls-li>Fixed occasional YouTube background video playback issues.</ls-li>\n			<ls-li>Fixed displaying project rounded corners in the editor.</ls-li>\n		</ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.9.6\n			<ls-small>Dec 5, 2023</ls-small>\n		</ls-h5>\n		<ls-ul><ls-li>Fixed minor issues and increased compatibility with projects built using older versions of LayerSlider.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.9.5\n			<ls-small>Nov 2, 2023</ls-small>\n		</ls-h5>\n		<ls-ul><ls-li>Fixed media autoplay issues in certain cases.</ls-li><ls-li>Fixed keyboard shortcut to start slide preview while in Revisions.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.9.3 - 7.9.4\n			<ls-small>Oct 28, 2023</ls-small>\n		</ls-h5>\n		<ls-ul><ls-li>Fixed minor issues in our previous update.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.9.2\n			<ls-small>Oct 27, 2023</ls-small>\n		</ls-h5>\n		<ls-list-title>Layer Management Enhancements</ls-list-title><ls-ul><ls-li>Toggling layers’ visibility has a new intermediate step to hide them only in the editor but keep them visible in previews and live projects. This can be useful when you have many layers and would like to hide some of them temporarily.</ls-li><ls-li>The editor’s “Bring selection to front” behavior is now turned off by default, and selected layers may not appear on top of overlapping layers.</ls-li><ls-li>Added new keyboard shortcuts for toggling layers’ visibility and locking.</ls-li><ls-li>Working with layers in the editor behaves more naturally and handles special cases.</ls-li></ls-ul><ls-list-title>Undo/Redo Enhancements</ls-list-title><ls-ul><ls-li>Added a new “Select Layer” entry type to the history list and fixed maintaining the correct layer selection when undoing/redoing.</ls-li><ls-li>Added notification when performing an undo/redo action (can be disabled in Interface Settings).</ls-li><ls-li>Undoing changes are much more reliable, and a lot of issues have been eliminated.</ls-li></ls-ul><ls-list-title>Miscellaneous</ls-list-title><ls-ul><ls-li>Fixed occasional JavaScript errors caused by Scroll Transition in hidden sliders.</ls-li><ls-li>Fixed a rare “Undefined array key” PHP error.</ls-li><ls-li>Fixed clipping and other rendering issues in specific cases.</ls-li><ls-li>Minor UI and under-the-hood improvements and bug fixes.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.9.1\n			<ls-small>Oct 16, 2023</ls-small>\n		</ls-h5>\n		<ls-ul><ls-li>Added a new layer action: Animate to Timeline Position.</ls-li><ls-li>Fixed post/page editing issues affecting some users.</ls-li><ls-li>Fixed disabling controls for Vimeo videos.</ls-li><ls-li>Fixed occasional rendering issues of pinned layers.</ls-li><ls-li>Project Settings → Appearance → Animate First Slide is now working with Performance Mode disabled.</ls-li><ls-li>Further under the hood improvements and optimizations.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.9.0\n			<ls-small>Oct 12, 2023</ls-small>\n		</ls-h5>\n		<ls-p><strong>This update is a major overhaul that will take LayerSlider to the next level of performance and usability. It also prepares for a new wave of professional templates to be released soon. Here’s the list of changes this update offers:</strong></ls-p><ls-list-title>Style &amp; Transitions</ls-list-title><ls-ul><ls-li>Added Rounded Corners option to Project Settings → Appearance.</ls-li><ls-li>Added Mask Transitions option to Layers → Style.</ls-li><ls-li>Added Reset option to Parallax Transition to choose whether the layer’s original state should be restored on slide change or when the mouse leaves the slider.</ls-li><ls-li>Added Start At First option to Opening Transition to set the initial timing used in the first cycle.</ls-li><ls-li>Added Stacking Order option to Opening and Ending Transitions.</ls-li><ls-li>Added “Mask Text Fragments” to the Overflow option in Text Transitions.<br>&nbsp;</ls-li><ls-li>Significantly improved Mask transition option in Opening/Loop/Ending Transitions with additional examples.</ls-li><ls-li>The random value syntax now accepts units such as “%” and custom LayerSlider units like “lw”, “lh”, “sw”, and “sh”.</ls-li><ls-li>If Scale X and Y use the same random formula, they will act as a linked field, and both will use the same random number to avoid distortions.<br>&nbsp;</ls-li><ls-li>Box and Text shadows are now responsive and properly scaled.</ls-li><ls-li>Animate First Slide now works with the Start Only In Viewport option in Project Settings.</ls-li><ls-li>Fixed rendering issues affecting certain 2D slide transitions.</ls-li><ls-li>Fixed some issues with responsive border/padding when using “em” units.</ls-li><ls-li>Fixed how the Min. Responsive Ratio option behaves in some cases.</ls-li><ls-li>Fixed layout issues of pinned layers in Full-width sliders.</ls-li></ls-ul><ls-list-title>Video &amp; Audio</ls-list-title><ls-ul><ls-li>You can now import/export self-hosted video and audio content.</ls-li><ls-li>Refreshed user interface throughout the editor related to media layers.</ls-li><ls-li>Added “Immediately” to the Autoplay option to allow playing media layers even before they complete their Opening Transition.<br>&nbsp;</ls-li><ls-li>The Project Preview now correctly reflects when “auto” is selected for the Play Muted option.</ls-li><ls-li>Fixed an issue where the Unmute button incorrectly appeared on some slides.</ls-li></ls-ul><ls-list-title>Interface &amp; Editor Features</ls-list-title><ls-ul><ls-li>The Slides List in the Project Editor can now be pinned as a minimized toolbar for quick access.</ls-li><ls-li>The editor now retains and re-calculates percentage values used for positioning when you move, drag, or resize layers.</ls-li><ls-li>You can now add custom keywords to your projects used for searching and organization purposes.<br>&nbsp;</ls-li><ls-li>When using the lasso, selectee layers will be highlighted for easier selection.</ls-li><ls-li>UI refresh and enhancements for the Templates Browser.</ls-li><ls-li>Capturing slides to set as thumbnails provides more accurate results.<br>&nbsp;</ls-li><ls-li>Fixed selecting, resizing, and working with layers using position adjustments.</ls-li><ls-li>Fixed some layout issues with Responsive sliders in Project Preview.</ls-li><ls-li>Several small but very meaningful user interface improvements to navigate the Project Editor more naturally and conveniently, as well as to make it more accessible for people with disabilities.</ls-li><ls-li>Fixed font rendering issues in dropdown lists affecting Safari.</ls-li></ls-ul><ls-list-title>Optimization &amp; Performance</ls-list-title><ls-ul><ls-li>Generating significantly cleaner and more optimized markup to improve load times and reduce network traffic.</ls-li><ls-li>Increased rendering performance and eliminated graphical issues in certain cases.</ls-li></ls-ul><ls-list-title>Integrations &amp; Compatibility</ls-list-title><ls-ul><ls-li>LayerSlider now comes with its own blank WordPress page template. It’s a clean canvas free of your theme’s interface elements, making it ideal for pages featuring only LayerSlider projects, such as Full-size sliders.</ls-li><ls-li>LayerSlider’s Gutenberg block has been updated with a Project Info panel and some UI retouches, and it’s now also accessible for page editors even if they don’t have permission to edit LayerSlider projects.</ls-li><ls-li>Increased compatibility with older versions of PHP, most notably, a PAAMAYIM_NEKUDOTAYIM error in PHP 5.4.</ls-li><ls-li>Improved compatibility with upcoming PHP versions.</ls-li></ls-ul><ls-p>Countless other optimizations, improvements, and bug fixes under the hood.</ls-p>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.8.0\n			<ls-small>Aug 11, 2023</ls-small>\n		</ls-h5>\n		<ls-ul><ls-li>Introducing Smart Background, a new feature that allows you to customize how layer backgrounds behave. You can detach the background from a layer to create an effect as if you were looking through the layer - like a window - to the background. For example, you can create mosaic-like images when used with multiple layers. <a target=\"_blank\" href=\"https://layerslider.com/blog/introducing-smart-background/\">Read our blog post</a> to see examples and learn more.</ls-li><ls-li>The whole project editor interface received countless improvements to enhance user experience and accessibility significantly. From clicking into option fields to selecting text, all behave more naturally. For example, text fields won\'t lose focus when clicking certain interface elements, smaller fields automatically expand to make room for longer values, etc. By popular demand, the active slide has also received a much more noticeable highlight.</ls-li><ls-li>A lot of additional transition properties can now handle random values. In addition to the already existing random feature, which picks a number from a range between two numbers, you can now also provide a list of fixed values to choose from randomly. They have a new, shorter, and easier syntax. Clicking the + sign next to a transition option field will reveal and provide examples for both.</ls-li><ls-li>Scroll Transition offers new transition properties: Alternate Transform Origin, Reverse Easing, and Reverse Duration. These allow you to drastically change how a layer reacts and animates when scrolling the page back and forth.</ls-li><ls-li>The color picker now offers a way to copy and paste colors and gradients across layers, slides, and projects. It now also properly updates as you undo/redo changes.</ls-li><ls-li>Assets Library now automatically retries downloading assets in case of a failed attempt, and it also comes with additional interface improvements.</ls-li><ls-li>System Status can now recognize and properly interpret and display special PHP settings used in edge cases.</ls-li><ls-li>Improved how layers with Parallax Transition behave and eliminated some jumpiness in certain cases.</ls-li><ls-li>Added additional mouse cursor options under the STYLE menu.</ls-li><ls-li>Fixed layout issues in OS native fullscreen mode.</ls-li><ls-li>Fixed an issue that prevented animating certain Ending Transition effects on slide change.</ls-li><ls-li>Fixed distorted images in the editor in rare and special cases depending on the zoom levels.</ls-li><ls-li>Fixed layer style filters not properly restored after cycling through slides.</ls-li><ls-li>Fixed the filter editor popup not correctly parsing special values in some cases.</ls-li><ls-li>Fixed an issue in the layers list that sometimes did not correctly reflect the selected layers in multi-select mode.</ls-li><ls-li>Lots of other small improvements and bug fixes under-the-hood.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.7.11\n			<ls-small>Jul 14, 2023</ls-small>\n		</ls-h5>\n		<ls-ul><ls-li>Fixed dynamic layers and other issues caused by the previous security update.</ls-li><ls-li>Significant rendering performance improvements for Chrome.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.7.10\n			<ls-small>Jul 12, 2023</ls-small>\n		</ls-h5>\n		<ls-ul><ls-li>This update contains very important security fixes. Updating is strongly recommended. <a target=\"_blank\" href=\"https://layerslider.com/blog/important-security-update/\">Read More</a></ls-li><ls-li>Added Project Settings → Thumbnail Navigation → Thumbnail Fill Mode option.</ls-li><ls-li>Replaced Twitter feed with a brand new News section.</ls-li></ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.7.9\n			<ls-small>Jul 3, 2023</ls-small>\n		</ls-h5>\n		<ls-ul>\n			<ls-li>Fixed certain Popup rendering and layout issues.</ls-li>\n		</ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.7.8\n			<ls-small>Jun 22, 2023</ls-small>\n		</ls-h5>\n		<ls-ul>\n			<ls-li>Added 30 brand-new 2D slide transitions with unique effects.</ls-li>\n			<ls-li>Added Project Settings → Appearance → Animate First Slide option to play the selected slide transition when a project first appears. Additional options are also available to override the transition duration and time shift.</ls-li>\n			<ls-li>New keyboard shorcuts: Use Ctrl/Cmd + ←/→ to quickly change slides in the editor.</ls-li>\n			<ls-li>Significant rendering performance improvements.</ls-li>\n			<ls-li>Heavily optimized some plugin files to improve load times and reduce network traffic.</ls-li>\n			<ls-li>Videos now always use the \"cover\" fill mode.</ls-li>\n			<ls-li>Increased compatibility with older projects when importing slides and layers.</ls-li>\n			<ls-li>Prevented web browsers from caching custom CSS and Transition Builder files.</ls-li>\n			<ls-li>Fixed an issue where position adjustments didn\'t work with parallax layers.</ls-li>\n			<ls-li>Fixed an issue that affected the Backdrop Filter option.</ls-li>\n			<ls-li>Fixed the slideTimelineDidUpdate callback event \"timeline\" parameter in Project Preview.</ls-li>\n			<ls-li>User interface and under-the-hood bug fixes and improvements.</ls-li>\n		</ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.7.7\n			<ls-small>Jun 6, 2023</ls-small>\n		</ls-h5>\n		<ls-p><strong>LayerSlider’s Assets Library just got even better.</strong> In addition to more than 9000 objects and millions of royalty-free stock photos, it now also offers stock videos. Make your content stand out and impress your visitors with just a few clicks for free.</ls-p>\n		<ls-p>Other changes:</ls-p>\n		<ls-ul>\n			<ls-li>Improved code formatting in Event Callbacks.</ls-li>\n			<ls-li>Fixed slideTimelineDidUpdate\'s \"timeline\" parameter in Event Callbacks.</ls-li>\n		</ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.7.6\n			<ls-small>May 23, 2023</ls-small>\n		</ls-h5>\n		<ls-ul>\n			<ls-li>Introducing: Position Adjustments. Fine-tune layer positions in a more refined way, especially if you want to align layers relative to the bottom and right edges.</ls-li>\n			<ls-li>Significant improvements and fixes for keyboard shortcuts.</ls-li>\n			<ls-li>Fixed an issue that resulted in media playback in the background while quickly changing slides.</ls-li>\n			<ls-li>Fixed a Chrome rendering issue where videos appeared blank in rare cases.</ls-li>\n			<ls-li>Fixed some layer style properties when using a min/max responsive ratio.</ls-li>\n			<ls-li>Fixed the \"Missing Ending Transitions\" warning that sometimes appeared incorrectly.</ls-li>\n			<ls-li>Other under-the-hood changes.</ls-li>\n		</ls-ul>\n	</ls-box>\n</ls-li>\n\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.7.5\n			<ls-small>May 8, 2023</ls-small>\n		</ls-h5>\n		<ls-p><strong>Ready to make your designs stand out?</strong> LayerSlider’s Assets Library just got a major upgrade and now offers millions of new royalty-free stock photos to choose from. Save time and impress your audience with stunning graphics in just a few clicks.</ls-p>\n		<ls-p>Other changes:</ls-p>\n		<ls-ul>\n			<ls-li>Added Project Settings → Miscellaneous → \"Fix resizing issues in special cases\" option.</ls-li>\n			<ls-li>Updated French localization. [Thanks to <a href=\"https://instinct-photo.fr/contact/\" target=\"_blank\">Patrick Perrono</a>]</ls-li>\n			<ls-li>Fixed certain exporting issues, especially affecting the \"Export as HTML\" option.</ls-li>\n			<ls-li>Fixed a resizing issue with static layers.</ls-li>\n			<ls-li>Fixed detecting available external fonts in the editor in Safari.</ls-li>\n			<ls-li>Fixed Text Transition rendering issues in Safari.</ls-li>\n			<ls-li>Layers with text transitions now properly inherit text decoration settings.</ls-li>\n			<ls-li>Various UI and under-the-hood enhancements and bug fixes.</ls-li>\n		</ls-ul>\n	</ls-box>\n</ls-li>\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.7.1\n			<ls-small>Apr 19, 2023</ls-small>\n		</ls-h5>\n		<ls-ul>\n			<ls-li>LayerSlider now fully supports WPML\'s Media Translation.&nbsp;</ls-li>\n			<ls-li>Translation features can now be adjusted under Plugin Settings → Integrations.</ls-li>\n			<ls-li>Updated French localization. [Thanks to <a href=\"https://instinct-photo.fr/contact/\" target=\"_blank\">Patrick Perrono</a>]</ls-li>\n		</ls-ul>\n	</ls-box>\n</ls-li>\n<ls-li>\n	<ls-box>\n		<ls-h5>\n			LayerSlider 7.7.0\n			<ls-small>Apr 5, 2023</ls-small>\n		</ls-h5>\n		<ls-p><strong>Introducing: Assets Library.</strong> Say goodbye to design roadblocks. Elevate your creative vision and easily bring your dream projects to life using our vast collection of professional assets. These pre-made graphics are designed for immediate use and can be quickly integrated into your projects with just a few clicks.</ls-p>\n		<ls-p>Other changes:</ls-p>\n		<ls-ul>\n			<ls-li>Icon, Shape, and SVG layers have new stroke color and width options.</ls-li>\n			<ls-li>Blob and Wave shapes now also support stroke.</ls-li>\n			<ls-li>Updated French localization [Thanks to <a href=\"https://instinct-photo.fr/contact/\" target=\"_blank\">Patrick Perrono</a>]</ls-li>\n			<ls-li>The editor now automatically detects certain transition issues and offers to fix them.</ls-li>\n			<ls-li>Significant rendering performance optimizations.</ls-li>\n			<ls-li>Improved automatic layer naming.</ls-li>\n			<ls-li>Improved layer preview in the layers list.</ls-li>\n			<ls-li>Improved SVG source normalization for better layer scaling.</ls-li>\n			<ls-li>SVG files dropped onto the editor now preserve their original sizes.</ls-li>\n			<ls-li>Fixed linked Video / Audio layers’ transition issues.</ls-li>\n			<ls-li>Fixed many undo/redo issues.</ls-li>\n			<ls-li>Fixed many multiple-selection mode issues.</ls-li>\n			<ls-li>Fixed a very rare import issue due to file name normalization.</ls-li>\n			<ls-li>Fixed Safari rendering issues with pinned layers.</ls-li>\n			<ls-li>Fixed an issue when opening Popups with specific slides.</ls-li>\n			<ls-li>Eliminated countless under-the-hood bugs.</ls-li>\n			<ls-li>Lots of small UI and other improvements.</ls-li>\n		</ls-ul>\n	</ls-box>\n</ls-li>\n\";s:16:\"important-notice\";a:9:{s:4:\"date\";s:10:\"2023-12-06\";s:5:\"title\";s:1:\" \";s:7:\"message\";s:557:\"<b>UPDATE REQUIRED:</b> You’re using an outdated version of LayerSlider, which lacks crucial fixes needed to be secure and compatible with the latest versions of PHP, WordPress, and popular 3rd party applications. The latest updates contain important security fixes, new features, countless improvements, and bug fixes. Please see the <a target=\"_blank\" href=\"https://layerslider.kreaturamedia.com/how-to-update/\">update instructions</a> or <a target=\"_blank\" href=\"https://layerslider.kreaturamedia.com/contact/\">contact us</a> if you have any questions.\";s:5:\"image\";s:0:\"\";s:6:\"banner\";a:5:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:132:\"height: auto; margin: 39px auto 0 auto !important; min-width: 700px; max-width: 1700px; padding-right: 20px; box-sizing: border-box;\";s:3:\"url\";s:0:\"\";s:6:\"target\";s:6:\"_blank\";s:7:\"content\";s:2135:\"\n\n		<style>\n			@import url(\"https://fonts.googleapis.com/css2?family=Nunito:wght@400;600;800&display=swap\");\n		</style>\n		<style>\n\n			body .layerslider_notice_img .dashicons-dismiss {\n				top: 0 !important;\n				right: 20px !important;\n			}\n\n			#lspr-inner {\n				position: relative;\n				height: auto;\n				margin: 0 auto !important;\n				background: rgb(106,58,233);\n				background: linear-gradient(153deg, rgba(106,58,233,1) 0%, rgba(1,148,233,1) 100%);\n				border-radius: 0.8rem;\n   				border-radius: calc( 0.7rem + 0.1vw );\n			}\n\n			body .layerslider_notice_img {\n				padding-left: 0 !important;\n			}\n\n			body.toplevel_page_layerslider .layerslider_notice_img {\n				padding-left: 30px !important;\n			}\n\n			.lspr-nowrap {\n				white-space: nowrap;\n			}\n\n			.lspr-highlight {\n				font-weight: bold;\n				text-transform: uppercase;\n			}\n\n			.lspr-text {\n				position: relative;\n				margin: 0 auto 0 auto;\n				padding: calc( 1.3rem + 0.1vw );\n				color: white;\n				font-family: Nunito, sans-serif;\n				font-size: 1rem;\n				font-size: calc( 0.9rem + 0.1vw );\n				line-height: normal;\n				text-align: justify;\n			}\n\n			.lspr-text a {\n				font-weight: 600;\n				text-decoration: none;\n				color: inherit;\n				box-sizing: content-box;\n				border-bottom: 2px solid currentColor;\n			}\n\n			.layerslider_notice_img  .dashicons-dismiss {\n				right: 30px;\n			}\n\n			.lspr-bold {\n				font-weight: 800 !important;\n			}\n\n		</style>\n		<div id=\"lspr-inner\">\n\n			<div class=\"lspr-text\">\n				<span><span class=\"lspr-highlight\">Update Required:</span> You’re using an outdated version of LayerSlider, which lacks crucial fixes needed to be secure and compatible with the latest versions of PHP, WordPress, and popular 3rd party applications. The latest updates contain important security fixes, new features, countless improvements, and bug fixes. Please see the <a href=\"https://layerslider.kreaturamedia.com/how-to-update/\" target=\"_blank\" class=\"lspr-nowrap\">update instructions</a> or <a href=\"https://layerslider.kreaturamedia.com/contact/\" target=\"_blank\" class=\"lspr-nowrap\">contact us</a> if you have any questions.\n				</span>\n			</div>\n\n		</div>\n		\";}s:11:\"min_version\";s:0:\"\";s:11:\"max_version\";s:5:\"7.2.0\";s:11:\"unactivated\";b:0;s:10:\"url_filter\";s:33:\"layerslider index.php plugins.php\";}s:14:\"latest-version\";s:6:\"7.11.1\";s:19:\"latest-version-date\";s:10:\"2024-05-22\";}','off');
