INSERT INTO `wp_options` VALUES (995,'ls-google-fonts-data','a:2:{s:9:\"languages\";a:28:{i:0;a:2:{s:4:\"lang\";s:5:\"latin\";s:8:\"sentence\";s:27:\"It\'s just a matter of time.\";}i:1;a:2:{s:4:\"lang\";s:9:\"latin-ext\";s:8:\"sentence\";s:54:\"Qui trop légèrement se fie, mal à propos se défie.\";}i:2;a:2:{s:4:\"lang\";s:6:\"arabic\";s:8:\"sentence\";s:54:\"الحب سماء لا تمطر غير الأحلام.\";}i:3;a:2:{s:4:\"lang\";s:7:\"bengali\";s:8:\"sentence\";s:182:\"আগুনের শিখা নিভে গিয়েছিল, আর তিনি জানলা দিয়ে তারাদের দিকে তাকালেন৷\";}i:4;a:2:{s:4:\"lang\";s:16:\"chinese-hongkong\";s:8:\"sentence\";s:57:\"他們所有的設備和儀器彷彿都是有生命的。\";}i:5;a:2:{s:4:\"lang\";s:19:\"chinese-traditional\";s:8:\"sentence\";s:57:\"他们所有的设备和仪器彷佛都是有生命的。\";}i:6;a:2:{s:4:\"lang\";s:18:\"chinese-simplified\";s:8:\"sentence\";s:57:\"他們所有的設備和儀器彷彿都是有生命的。\";}i:7;a:2:{s:4:\"lang\";s:8:\"cyrillic\";s:8:\"sentence\";s:90:\"Алая вспышка осветила силуэт зазубренного крыла.\";}i:8;a:2:{s:4:\"lang\";s:12:\"cyrillic-ext\";s:8:\"sentence\";s:90:\"Алая вспышка осветила силуэт зазубренного крыла.\";}i:9;a:2:{s:4:\"lang\";s:10:\"devanagari\";s:8:\"sentence\";s:156:\"अंतरिक्ष यान से दूर नीचे पृथ्वी शानदार ढंग से जगमगा रही थी ।\";}i:10;a:2:{s:4:\"lang\";s:5:\"greek\";s:8:\"sentence\";s:42:\"Ήταν απλώς θέμα χρόνου.\";}i:11;a:2:{s:4:\"lang\";s:9:\"greek-ext\";s:8:\"sentence\";s:42:\"Ήταν απλώς θέμα χρόνου.\";}i:12;a:2:{s:4:\"lang\";s:8:\"gujarati\";s:8:\"sentence\";s:136:\"અમને તેની જાણ થાય તે પહેલાં જ, અમે જમીન છોડી દીધી હતી.\";}i:13;a:2:{s:4:\"lang\";s:8:\"gurmukhi\";s:8:\"sentence\";s:58:\"ਸਵਾਲ ਸਿਰਫ਼ ਸਮੇਂ ਦਾ ਸੀ।\";}i:14;a:2:{s:4:\"lang\";s:6:\"hebrew\";s:8:\"sentence\";s:63:\"אז הגיע הלילה של כוכב השביט הראשון.\";}i:15;a:2:{s:4:\"lang\";s:8:\"japanese\";s:8:\"sentence\";s:51:\"彼らの機器や装置はすべて生命体だ。\";}i:16;a:2:{s:4:\"lang\";s:7:\"kannada\";s:8:\"sentence\";s:76:\"ಇದು ಕೇವಲ ಸಮಯದ ಪ್ರಶ್ನೆಯಾಗಿದೆ.\";}i:17;a:2:{s:4:\"lang\";s:5:\"khmer\";s:8:\"sentence\";s:173:\"ខ្ញុំបានមើលព្យុះ ដែលមានភាពស្រស់ស្អាតណាស់ ប៉ុន្តែគួរឱ្យខ្លាច\";}i:18;a:2:{s:4:\