nk\">Kreatura Media</a>\";s:3:\"url\";s:24:\"https://layerslider.com/\";s:8:\"external\";b:1;s:9:\"file_name\";s:10:\"plugin.zip\";s:5:\"icons\";a:3:{s:2:\"1x\";s:89:\"https://repository.kreaturamedia.com/v4/updates/1362246/assets/icon-128x128.png?ver=6.9.2\";s:2:\"2x\";s:89:\"https://repository.kreaturamedia.com/v4/updates/1362246/assets/icon-256x256.png?ver=6.9.2\";s:7:\"default\";s:89:\"https://repository.kreaturamedia.com/v4/updates/1362246/assets/icon-256x256.png?ver=6.9.2\";}s:7:\"banners\";a:3:{s:3:\"low\";s:94:\"https://repository.kreaturamedia.com/v4/updates/1362246/assets/thumbnail-772x250.png?ver=6.9.2\";s:4:\"high\";s:95:\"https://repository.kreaturamedia.com/v4/updates/1362246/assets/thumbnail-1544x500.png?ver=6.9.2\";s:7:\"default\";s:95:\"https://repository.kreaturamedia.com/v4/updates/1362246/assets/thumbnail-1544x500.png?ver=6.9.2\";}s:8:\"sections\";a:3:{s:9:\"changelog\";s:329:\"<p style=\"text-align: justify;\">\n	<a href=\"https://layerslider.com/release-log/\" target=\"_blank\">Click here to see the release log.</a> Don’t forget, the release log and all product-related news are also integrated right into LayerSlider. Look for the “LayerSlider News” section at the bottom of its main admin screen.\n</p>\";s:12:\"installation\";s:549:\"<p style=\"text-align: justify;\">\n	Updating the plugin won’t touch your sliders or settings. New versions always have backward compatibility. You don’t have to worry about losing your work. Not sure how to update? Check the <a href=\"https://layerslider.com/documentation/#updating\" target=\"_blank\">Updating</a> section of our online documentation.\n</p>\n\n<p style=\"text-align: justify;\">\n	If you’re experiencing unwanted changes, it is always a good idea to check your settings since there are probably new options to control those changes.\n</p>\";s:3:\"faq\";s:537:\"<p style=\"text-align: justify;\">\n	Please visit our <a href=\"https://layerslider.com/help/\" target=\"_blank\">Help</a> page, where you can find all sorts of useful assets like <a href=\"https://layerslider.com/faq/\" target=\"_blank\">FAQs</a>, <a href=\"https://layerslider.com/documentation/\" target=\"_blank\">online documentation</a>, <a href=\"https://layerslider.com/documentation/#troubleshooting\" target=\"_blank\">troubleshooting</a>, and <a href=\"https://layerslider.com/documentation/#support\" target=\"_blank\">support</a> information.\n</p>\";}s:4:\"slug\";s:11:\"LayerSlider\";s:7:\"package\";s:0:\"\";s:13:\"download_link\";s:0:\"\";}s:15:\"_latest_version\";s:6:\"7.11.1\";s:17:\"_important_notice\";a:9:{s:4:\"date\";s:10:\"2023-12-06\";s:5:\"title\";s:1:\" \";s:7:\"message\";s:557:\"<b>UPDATE REQUIRED:</b> You’re using an outdated version of LayerSlider, which lacks crucial fixes needed to be secure and compatible with the latest versions of PHP, WordPress, and popular 3rd party applications. The latest updates contain important security fixes, new features, countless improvements, and bug fixes. Please see the <a target=\"_blank\" href=\"https://layerslider.kreaturamedia.com/how-to-update/\">update instructions</a> or <a target=\"_blank\" href=\"https://layerslider.kreaturamedia.com/contact/\">contact us</a> if you have any questions.\";s:5:\"image\";s:0:\"\";s:6:\"banner\";a:5:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:132:\"height: auto; margin: 39px auto 0 auto !important; min-width: 700px; max-width: 1700px; padding-right: 20px; box-sizing: border-box;\";s:3:\"url\";s:0:\"\";s:6:\"target\";s:6:\"_blank\";s:7:\"content\";s:2135:\"\n\n		<style>\n			@import url(\"https://fonts.googleapis.com/css2?family=Nunito:wght@400;600;800&display=swap\");\n		</style>\n		<style>\n\n			body .layerslider_notice_img .dashicons-dismiss {\n				top: 0 !important;\n				right: 20px !important;\n			}\n\n			#lspr-inner {\n				position: relative;\n				height: auto;\n				margin: 0 auto !important;\n				background: rgb(106,58,233);\n				background: linear-gradient(153deg, rgba(106,58,233,1) 0%, rgba(1,148,233,1) 100%);\n				border-radius: 0.8rem;\n   				border-radius: calc( 0.7rem + 0.1vw );\n			}\n\n			body .layerslider_notice_img {\n				padding-left: 0 !important;\n			}\n\n			body.toplevel_page_layerslider .layerslider_notice_img {\n				padding-left: 30px !important;\n			}\n\n			.lspr-nowrap {\n				white-space: nowrap;\n			}\n\n			.lspr-highlight {\n				font-weight: bold;\n				text-transform: uppercase;\n			}\n\n			.lspr-text {\n				position: relative;\n				margin: 0 auto 0 auto;\n				padding: calc( 1.3rem + 0.1vw );\n				color: white;\n				font-family: Nunito, sans-serif;\n				font-size: 1rem;\n				font-size: calc( 0.9rem + 0.1vw );\n				line-height: normal;\n				text-align: justify;\n			}\n\n			.lspr-text a {\n				font-weight: 600;\n				text-decoration: none;\n				color: inherit;\n				box-sizing: content-box;\n				border-bottom: 2px solid currentColor;\n			}\n\n			.layerslider_notice_img  .dashicons-dismiss {\n				right: 30px;\n			}\n\n			.lspr-bold {\n				font-weight: 800 !important;\n			}\n\n		</style>\n		<div id=\"lspr-inner\">\n\n			<div class=\"lspr-text\">\n				<span><span class=\"lspr-highlight\">Update Required:</span> You’re using an outdated version of LayerSlider, which lacks crucial fixes needed to be secure and compatible with the latest versions of PHP, WordPress, and popular 3rd party applications. The latest updates contain important security fixes, new features, countless improvements, and bug fixes. Please see the <a href=\"https://layerslider.kreaturamedia.com/how-to-update/\" target=\"_blank\" class=\"lspr-nowrap\">update instructions</a> or <a href=\"https://layerslider.kreaturamedia.com/contact/\" target=\"_blank\" class=\"lspr-nowrap\">contact us</a> if you have any questions.\n				</span>\n			</div>\n\n		</div>\n		\";}s:11:\"min_version\";s:0:\"\";s:11:\"max_version\";s:5:\"7.2.0\";s:11:\"unactivated\";b:0;s:10:\"url_filter\";s:33:\"layerslider index.php plugins.php\";}s:14:\"_not_activated\";b:1;s:16:\"_sub_deactivated\";b:0;s:7:\"checked\";i:1723474