INSERT INTO `wp_postmeta` VALUES (11208,3548,'page_custom_css','.rounded-button {\n	border-radius: 25px !important;\n}\n\n.no-margin-bottom {\n	margin-bottom: 0px !important;\n}\n\n.wpb_wrapper .vc_tta-tabs.vc_tta-style-theme-styled-minimal .vc_tta-tabs-list li a {\n	font-size: 25px !important;\n}\n\n.wpb_wrapper .vc_tta-tabs.vc_tta-style-theme-styled-minimal .vc_tta-tabs-list li.vc_active a:after {\n	display: none;\n}\n\n.wrapper a:after, footer.main-footer a:after {\n	display: none !important;\n}\n\n.wpb_wrapper .vc_tta-tabs.vc_tta-style-theme-styled-minimal .vc_tta-tabs-list li.vc_active a, .vc_tta.vc_general .vc_tta-panel-title>a  {\n	color: #FFF !important;\n	border-bottom-color: transparent;\n}\n\n.comment-form textarea, .contact-form textarea {\n	background-image: linear-gradient(#444 1px,transparent 1px);\n}\n\n.comment-form input, .comment-form textarea, .contact-form input, .contact-form textarea {\n	border-bottom-color: #444 !important;\n}\n\n\n.comment-form input, .comment-form textarea, .contact-form input, .contact-form textarea {\n	color: #FFF !important;\n}\n\n.message-form .form-group .placeholder {\n	border-bottom-color: #fff;\n	color: #FFF;\n}\n\n.lab-no-padding-left-right {\n	padding-left: 0px !important;\n   	padding-right: 0px !Important;\n}\n\n.message-form .send {\n	background:#f7cf5a;\n	border-radius: 25px !important;\n	color: #735D1C;\n}\n\n.message-form .send:hover {\n	background:#f7cf5a;\n	color: #735D1C;\n	border-radius: 25px !important;\n}\n\n.wpb_wrapper .icon-box-container {\n	background-position: right !important;\n}\n\n.centering-text-header .wpb_wrapper {\n	margin: 0 auto !important;\n}\n\n.wpb_wrapper .vc_tta-tabs.vc_tta-style-theme-styled-minimal .vc_tta-tabs-list li.vc_active a, .vc_tta.vc_general .vc_tta-panel-title>a {\n	padding: 0px !important;\n}\n\n.no-margin-divider {\n	margin-bottom: 20px !important;\n}\n\n.no-margin-divider .lab-divider-content {\n	margin-left: 0px !important;\n}\n\n@media screen and (max-width: 480px){\n	.project-tabs {\n		padding: 0px 20px !important;\n	}\n\n	.feature-tabs {\n		padding: 30px 20px !important;\n	}\n	\n	.wpb_wrapper .icon-box-container {\n		padding: 0px !important;\n	}\n\n	.centering-text-header {\n		padding: 0 20px;\n	}\n}\n\n@media only screen and (max-width : 768px) {\n	.project-tabs {\n		padding: 0px 20px !important;\n	}\n	\n	.centering-text-header {\n		padding: 0 20px;\n	}\n	\n	.wpb_wrapper .icon-box-container {\n		padding: 0px !important;\n	}\n\n	.feature-tabs {\n		padding: 30px 20px !important;\n	}\n	\n	.medium-width {\n		width: 100% !important;\n	}\n}\n\n@media only screen and (max-width : 992px) {\n	.project-tabs {\n		padding: 0px 20px !important;\n	}\n\n	\n	.medium-width {\n		width: 100% !important;\n	}\n\n	.feature-tabs {\n		padding: 30px 20px !important;\n	}\n}');
