INSERT INTO `wp_posts` VALUES (48,2,'2024-08-01 15:29:03','2024-08-01 15:29:03','<!-- wp:paragraph -->\r\n<p><!-- wp:heading {\"level\":4} --></p>\r\n<h4 class=\"wp-block-heading\"><a href=\"#directorjump\">Director   </a> <a href=\"#trailerjump\">Trailer    </a>  <a href=\"#creditsjump\">Credits   </a> <a href=\"#photosjump\">Photos   </a> <a href=\"#contactsjump\">Contacts   </a> <a href=\"#pressjump\">Press   </a> <a href=\"#screeningsjump\">Screenings</a></h4>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":6} --></p>\r\n<h6 class=\"wp-block-heading\">All across the globe, Chinatowns are under threat of disappearing –<br />and along with them, the rich history of communities who fought from the margins for a place to belong.</h6>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Big Fight in Little Chinatown is a story of community resistance and resilience. Set against the backdrop of the COVID pandemic and an unprecedented rise in anti-Asian racism, the documentary takes us into the lives of residents, businesses and community organizers whose neighbourhoods are facing active erasure.</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>​​Coast to Coast the film follows Chinatown communities resisting the pressures around them. From the construction of the world’s largest vertical jail in New York, Montreal’s fight against developers swallowing up the most historic block of their Chinatown, big box chains and gentrification forces displacing Toronto’s community, to a Vancouver Chinatown business holding steadfast, the film reveals how Chinatown is both a stand-in for other communities who’ve been wiped off the city map, and the blueprint for inclusive and resilient neighbourhoods of the future.</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":4} --></p>\r\n<h4 class=\"wp-block-heading\"><strong>Year</strong></h4>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>2022</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":4} --></p>\r\n<h4 class=\"wp-block-heading\"><strong>Duration</strong></h4>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>88min, 58min, 52min</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":4} --></p>\r\n<h4 class=\"wp-block-heading\"><strong>Social</strong></h4>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":6} --></p>\r\n<h6 class=\"wp-block-heading\"> </h6>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} --></p>\r\n<h3 class=\"wp-block-heading\"><a id=\"directorjump\"></a>ABOUT THE DIRECTOR</h3>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p><strong>KAREN CHO</strong> (曹嘉伦) is a Chinese-Canadian filmmaker known for her socio-political documentaries.</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Karen’s first film <em><strong>In the Shadow of Gold Mountain</strong></em> (2004) explored the legacy of the Chinese Head Tax, Exclusion Act and redress movement.</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Karen’s other films include the Gemini-Nominated Seeking Refuge (2009) a film on refugees in Canada and <em><strong>Status Quo? The Unfinished Business of Feminism in Canada</strong></em> (2012) that won Best Documentary at the Whistler Film Festival and launched in over 67 community screenings across the country.</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Karen’s TV work has touched on subjects like Indigenous health and wellness, Japanese Canadian internment, Quebecois cuisine, Vancouver’s downtown east side, and artist activists around the world. In 2018 Karen was nominated for a Best Directing Canadian Screen Award for her work on CBC’s <em><strong>Interrupt This Program</strong></em>.</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":3} --></p>\r\n<h3 class=\"wp-block-heading\"><a id=\"trailerjump\"></a>TRAILER</h3>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:shortcode --></p>\r\n<p>[embed]https://youtu.be/GTI0aeGA4d8?feature=shared[/embed]</p>\r\n<p><!-- /wp:shortcode -->\r\n\r\n<!-- wp:heading {\"level\":3} --></p>\r\n<h3 class=\"wp-block-heading\">CREDITS</h3>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Written &amp; Directed by<br /><strong>Karen Cho</strong></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Producer<br /><strong>Bob Moore</strong></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Executive Producers<br /><strong>Mila Aung-Thwin, Daniel Cross</strong></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Executive Producer, TVO<br /><strong>Jane Jankovic</strong></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Independent Production Officer, TVO <strong>Linda Fong</strong></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Editor<br /><strong>Ryan Mullins</strong></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Cinematographers<br /><strong>Nathaniel Brown, Joshua Frank</strong></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Original Music<br /><strong>David Drury</strong></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Line Producer<br /><strong>Valerie Shamash</strong></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>Co-Producer<br /><strong>Katie McKay</strong></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":3} --></p>\r\n<h3 class=\"wp-block-heading\">CONTACTS</h3>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":4} --></p>\r\n<h4 class=\"wp-block-heading\">WEBSITE</h4>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:embed {\"url\":\"https://www.bigfightinlittlechinatown.com\"} --></p>\r\n<figure class=\"wp-block-embed\">\r\n<div class=\"wp-block-embed__wrapper\">https://www.bigfightinlittlechinatown.com</div>\r\n</figure>\r\n<p><!-- /wp:embed -->\r\n\r\n<!-- wp:heading {\"level\":4} --></p>\r\n<h4 class=\"wp-block-heading\">SCREENINGS</h4>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p><a href=\"mailto:distribution@eyesteelfilm.com\">MONICA VICTORIA </a>at EYESTEELFILM</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":4} --></p>\r\n<h4 class=\"wp-block-heading\">SALES</h4>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p><a href=\"mailto:distribution@eyesteelfilm.com\">EYESTEELFILM</a></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":3} --></p>\r\n<h3 class=\"wp-block-heading\">PHOTO</h3>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} --></p>\r\n<h3 class=\"wp-block-heading\">PRESS</h3>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>“More than most people, Cho understands the importance of Chinatowns to the Chinese diaspora and why, over a century after the first Chinese immigrants came to Canada, they continue to be iportant meeting places for our community.”</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":5} --></p>\r\n<h5 class=\"wp-block-heading\"><strong> —<a href=\"https://povmagazine.com/karen-cho-on-the-fight-to-keep-chinatowns-big-and-small/\">POV MAGAZINE</a></strong></h5>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>“Its a wonderful portrait of a group of people who understand that you really shouldn\'t destroy the past for something new.”</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":5} --></p>\r\n<h5 class=\"wp-block-heading\"><strong>—<a href=\"http://www.unseenfilms.net/2022/11/big-fight-in-chinatown-2022-doc-nyc-2022.html\">UNSEEN FILMS</a></strong></h5>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>“The film offers a beautiful rendition of community-building, where people bound by tradition were able to hold on to meaning, in spite of the world’s downfall into senselessness.\"</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":5} --></p>\r\n<h5 class=\"wp-block-heading\"><strong> <a href=\"https://nyunews.com/arts/film/2022/11/07/doc-nyc-what-to-watch/\">—THE WASHINGTON SQUARE NEWS</a></strong></h5>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} --></p>\r\n<h3 class=\"wp-block-heading\">AWARDS &amp; FESTIVALS</h3>\r\n<p><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p><strong>AWARDS</strong></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>RIDM People’s Choice Award<br />RIDM Women Inmate Jury Award<br />Best Documentary Canada China International Film Festival<br />Best Documentary Markham Film Festival</p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p><strong>FESTIVALS</strong></p>\r\n<p><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></p>\r\n<p>DOC NYC (USA)<br />Reel Asian (CANADA)<br />RIDM (CANADA)<br />Big Sky Documentary Film Festival (USA)<br />Colorado Dragon Boat FF (USA)<br />DisOrient Asian American Film Fest (USA)<br />DOXA (CANADA)<br />Fascinasian #1 (CANADA)<br />Los Angeles Asian Pacific Film Festival (USA)<br />CAAMFEST (USA)<br />Fascinasian #2 (CANADA)<br />HAAPI FEST (USA)<br />L’ Outaouais Film Festival (CANADA)<br />Canada China Film Fest (CANADA)<br />Asian American International Film Festival (USA)<br />Melbourne Documentary Film festival (AUS)<br />Sydney Film Festival (AUS)<br />LANE DOC FEST (USA)<br />Madison\'s Asian American Media Spotlight (USA)<br />KDocsFF (CANADA)</p>\r\n<p><!-- /wp:paragraph --></p>\r\n<!-- /wp:paragraph -->','Test','','inherit','closed','closed','','29-revision-v1','','','2024-08-01 15:29:03','2024-08-01 15:29:03','',29,'http://esf.local/?p=48',0,'revision','',0);
