INSERT INTO `wp_posts` VALUES (2931,2,'2015-03-13 20:30:46','2015-03-13 20:30:46','<!-- wp:image {\"align\":\"right\",\"id\":3583,\"width\":463,\"height\":331} -->\n<figure class=\"wp-block-image alignright is-resized\"><a href=\"http://esf.local/wp-content/uploads/2017/01/landscape5.jpg\"><img src=\"//demo-content.kaliumtheme.com/agency/wp-content/uploads/2017/01/landscape5.jpg\" alt=\"\" class=\"wp-image-3583\" width=\"463\" height=\"331\"/></a><figcaption class=\"wp-element-caption\">I love Kalium</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Good ideas don\'t require proper <strong>planning</strong> or schedule; nor do they benefit from exhaustingly long meetings and conversations with management. They emerge from experiments, from playing around with things that you care about, things to which you have an emotional attachment. And quite often they need a creative chaotic environment to flourish and grow.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>However, the path from an idea to a tangible product is full of failures, and it\'s those inevitable, sometimes devastating failures that make you stronger and keep you going, and eventually—if you don\'t give in easily—drive you in the right direction, just to finally pave the boardwalk to something that might turn out to be changing and defining your future.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Of course we all should benefit from the knowledge of others—people who trust themselves to actually follow through their weird, unrealistic, and sometimes stubborn, naive ideas. But we should be able to learn and grow from our own mistakes, too. If you are willing to experiment and tackle failures along the way, you have to be able to make your own mistakes. And that means making an effort to beat the odds—no matter how doomed that shiny new idea might initially look.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"left\",\"id\":3585,\"width\":381,\"height\":272} -->\n<figure class=\"wp-block-image alignleft is-resized\"><a href=\"http://esf.local/wp-content/uploads/2017/01/landscape3.jpg\"><img src=\"//demo-content.kaliumtheme.com/agency/wp-content/uploads/2017/01/landscape3.jpg\" alt=\"\" class=\"wp-image-3585\" width=\"381\" height=\"272\"/></a><figcaption class=\"wp-element-caption\">I\'m a image Caption. In fact i\'m a very long caption but Kalium supports me so I don\'t worry for that.</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>In fact, usually that initial creative spark sounds just so ridiculous, unreasonable and improbable at first, and often even worse after the first critical review. But sometimes it doesn\'t matter. Yes, it just doesn\'t matter. Perhaps it\'s your time to succeed where others failed, and risk your personal time to gain strength, experience and wisdom that others gained before you. Perhaps you are doomed to fail, but you might build something in the end that will lead you to success in the future as you combine that idea with the inspiration you\'ll find in your cellar years from now.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Happiness is a ploy. Just a carrot on a stick.., sometimes. Maybe more than others. Maybe happiness is just far away. Like looking on a map, and finding how long it takes to get there. Wondering how much time you should take off. That\'s really how I\'d look at it. Like if I drive faster, I could get to the happiness I\'ve been looking for all my life sooner.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Maybe just really lonely. Maybe I just want to be alone. Maybe loneliness is the only way to make that happen. Like having two pairs of eyes and just seeing the same thing. Seems like such a late hour. Nothing seems, or feels new anymore. I\'d live again, to feel that way once more.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Loneliness for miles. Down every turn. A dusty road to nowhere. In everything that is given. Loneliness seems to make it\'s way back into our life\'s. Deeper into our hearts. I\'ll never know the meaning of it. The why. Exhausted and much too old to chase it\'s ever present here and now.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p>It\'s hard to stress how thrilled we are with the results of our new magazine! Since the launch, customers, affiliates, and investors continue to go out of their way to send their compliments, and that is great news for all of us.</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>However, the path from an idea to a tangible product is full of failures, and it\'s those inevitable, sometimes devastating failures that make you stronger and keep you going, and eventually—if you don\'t give in easily—drive you in the right direction, just to finally pave the boardwalk to something that might turn out to be changing and defining your future.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Of course we all should benefit from the knowledge of others—people who trust themselves to actually follow through their weird, unrealistic, and sometimes stubborn, naive ideas. But we should be able to learn and grow from our own mistakes, too. If you are willing to experiment and tackle failures along the way, you have to be able to make your own mistakes. And that means making an effort to beat the odds—no matter how doomed that shiny new idea might initially look.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"right\"} -->\n<p class=\"has-text-align-right\">Original source:&nbsp;<a title=\"Ylli Pylla\" href=\"https://1.envato.market/KYm9a\" target=\"_blank\" rel=\"noopener noreferrer\">Ylli Pylla</a></p>\n<!-- /wp:paragraph -->','Best Tips for a Successful Magazine','','trash','open','open','','best-tips-for-a-successful-magazine__trashed','','','2024-08-05 23:35:44','2024-08-05 23:35:44','',0,'http://demo-content.kaliumtheme.com/agency/?p=2931',0,'post','',2);
