INSERT INTO `wp_posts` VALUES (3763,2,'2024-08-05 23:34:14','2024-08-05 23:34:14','ALTRU Chair is what it is meant to be, honest and simple.\n\nI wanted to go back to the classic language of Japanese traditional craftsmanship wiliest being a representation of modernity and function of minimalist selflessness.\n\nALTRU\'s language emphasizes first being a seat with no metal parts entirely pressure fastened joints along with a extra lap support undercarriage to survive decades of usage. Embracing the pure nature of the wood I highlighted continuity and ubiquity within the chairs profile. Accentuating a honest symmetry and rhythm from the minimal arch formed within the chair legs. While the construction maintains japanese mortise tenon wedge joints within the seat from the legs, showing the wedges as a homage to the craftsmanship from decades ago, it stays true to purpose.\n\n&nbsp;','ALTRUchair','','inherit','closed','closed','','558-revision-v1','','','2024-08-05 23:34:14','2024-08-05 23:34:14','',558,'http://esf.local/?p=3763',0,'revision','',0);
